import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    const token = localStorage.getItem("token");
    localStorage.removeItem("token");
    console.log(token);
    navigate("/login");
  };

  // Retrieving user information from localStorage
  const name = localStorage.getItem("name");
  const email = localStorage.getItem("email");

  // Check if name and email exist
  if (!name || !email) {
    console.error("Name or email not found in localStorage");
    // Redirect to login or handle the situation accordingly
    navigate("/login");
    return null;
  }

  return (
    <div className="dashboard-container">
      {/* Side Navbar */}
      <div className="side-navbar">
        <h2>{name}</h2>
        <p>{email}</p>
        <div className="btns">
          <button className="btn btn-danger" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {/* Your existing content goes here */}
        <h1>Welcome to the Dashboard, {name}!</h1>
        {/* Add more content as needed */}
      </div>
    </div>
  );
};

export default Dashboard;
